Let $\overline{AD}$ be the altitude from $A,$ and let $x = AD.$

[asy]
unitsize (0.15 cm);

pair A, B, C, D;

B = (0,0);
C = (32,0);
A = (8,12);
D = (8,0);

draw(A--B--C--cycle);
draw(A--D);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, S);
label("$x$", (A + D)/2, E);
[/asy]

Then $BD = \frac{x}{3/2} = \frac{2x}{3},$ and $CD = \frac{x}{1/2} = 2x,$ so
\[BC = BD + DC = \frac{2x}{3} + 2x = \frac{8x}{3}.\]Since $BC = 32,$ $x = 12.$

Therefore, $[ABC] = \frac{1}{2} \cdot AD \cdot BC = \frac{1}{2} \cdot 12 \cdot 32 = .$

