Here's the solution in GNU Octave:

```octave
% Define the points
A = [1, 1];
B = [-1.5, 0.3];
C = [-1, -1];
D = [1.5, -0.3];
O = [0, 0];
H = [0, 2.5];

% Calculate the midpoint M of CD
M = (C + D) / 2;

% Calculate the slope of the perpendicular bisector of CD
m_pb = -1 / (2 * (D(2) - C(2)))

% Find the equation of the perpendicular bisector
a_pb = M(2) - m_pb * M(1);
b_pb = 0;

% Solve for the intersection points of the perpendicular bisector and the line segment CD
x_int = solve([M(1) - (a_pb + b_pb * C(1)), M(1) - (a_pb + b_pb * D(1))], C(1), D(1));
y_int = m_pb * x_int;

