function smallest_number = find_smallest_number(remainder)
    smallest_number = 2;
    for i = 3:60
        if (mod(i, 3) ~= remainder || mod(i, 4) ~= remainder || mod(i, 5) ~= remainder || mod(i, 6) ~= remainder)
            continue;
        end
        if (i < smallest_number)
            smallest_number = i;
        end
