Let $O$ be the origin.  Then we can express the area of triangle $ABC$ as
\[[ABC] = [ABO] + [BCO] - [ACO].\][asy]
unitsize(1.5 cm);

pair A, B, C, O;

A = 2*dir(70);
B = 2*sqrt(3)*dir(40);
C = 3*dir(10);

draw(A--B--C--cycle);
draw(A--O);
draw(B--O);
draw(C--O);
draw((-0.5,0)--(3,0));
draw((0,-0.5)--(0,2.5));

label("$A$", A, NW);
label("$B$", B, NE);
label("$C$", C, E);
label("$O$", O, SW);
[/asy]

We have that
