        diff = hypot_init - hypot_current;
        if diff > max_diff
            max_diff = diff;
        elseif diff < min_diff
            min_diff = diff;
        endif
    endif
endfor

fprintf('Minimum difference: %d\n', min_diff);
fprintf('Maximum difference: %d\n', max_diff);
```

The output of the code will be:

```
Minimum difference: 0
Maximum difference: 1
```

