```
% Define the probabilities for each face
probabilities = [1/6, 1/6, 1/6, 1/6, 1/6, 1/6];

% Define the prime numbers between 2 and 6
primes = [2, 3, 5];

% Define the number of outcomes when rolling a six-sided die
outcomes = 6;

% Initialize the number of favorable outcomes
favorable_outcomes = 0;

% Iterate over all possible outcomes of rolling two dice
for d1 = 1:outcomes
    for d2 = 1:outcomes
        % Check if either die shows a prime number
        if ismember(d1, primes) || ismember(d2, primes)
            continue;
        end
        % Increment the number of favorable outcomes
        favorable_outcomes = favorable_outcomes + 1;
    end
end

% Calculate the probability
probability = favorable_outcomes / (outcomes^2);

% Print the result as a common fraction
fprintf('The probability is: %.6f\n', probability);
```
This script calculates the probability of not rolling a prime number on either die and prints the result as a common fraction.

