Here's a simple recursive function in Octave that calculates the number of valid colorings:

```octave
function num_colorings(n, colors)
 if n == 1
 return colors(1);
 endif

 total = 0;
 for i = 1:colors
 for j = (i == 1) ? 2:colors
 if (adjacent(i, j))
 continue;
