Here is a sample code:

```
function roots = find_roots()
    x = fsolve(@(x) sin(x) - sin(pi*x), 0:0.01:10);
    roots = degrees(x);
    roots = roots(find(mod(roots, 2*pi) < pi));
    m = roots(1)*(2*pi - mod(roots(1), 2*pi))/pi;
    n = roots(2)*(2*pi - mod(roots(2), 2*pi))/pi;
    p = roots(3)*(2*pi - mod(roots(3), 2*pi))/pi;
    q = roots(4)*(2*pi - mod(roots(4), 2*pi))/pi;
    m + n + p + q;
end
```

This code finds the roots of the equation sin(x) - sin(pi*x) = 0, converts them to degrees, and then calculates the required values of m, n, p, and q. Finally, it returns the sum of m+n+p+q.

So, the answer is 'True'.

