The given triangle is a right-angled triangle with sides 5, 12, and 13, which form the 3-4-5 Pythagorean triple. The hypotenuse (13) is the side opposite the right angle, and the other two sides (5 and 12) are the legs.

The inradius and circumradius of the triangle can be calculated using the formulae:

1. Inradius (r): r = s / 2 * (s - a) / √(a * (a - b) * (a - c)), where s is the semi-perimeter, a, b, and c are the sides of the triangle.
2. Circumradius (R): R = s / 2.

The distance between the centers of the inscribed and circumscribed circles is the difference between the circumradius and the inradius.

Here is the code to solve the problem in GNU Octave:

```
a = 5;
b = 12;
c = 13;
s = (a + b + c) / 2;
r = s / 2 * (s - a) / sqrt(a * (a - b) * (a - c));
R = s / 2;
diff = R - r;
diff_simplified = simplify(diff);
```

The output of the code will be the distance between the centers of the circles as a simplified fraction in radical form.

