  for m = 1:m_max
      for n = m+1:n_max
          % Check if m and n are relatively prime
          if gcd(m,n) > 1
              continue;
          end

          % Define the complex numbers z and w
          z = exp(1i * pi * sin(m*pi/n));
          w = z^11;

          % Check if w^11 equals z
          if abs(w^11 - z) < 1e-14
              % Check if the imaginary part of z is equal to sin(m*pi/n)
              if abs(imag(z) - sin(m*pi/n)) < 1e-14
                  % Update the minimum value of n
                  min_n = n;
              end
          end
      end
  end

