The number of ways to divide a set of n items into two subsets of k items each (without restrictions) is given by the binomial coefficient:

C(n, k) = n! / (k!(n-k)!)

In this case, n = 10 and k = 5. So, we can calculate the number of ways using the formula:

C(10, 5) = 10! / (5! * (10-5)!)

We can implement this in GNU Octave as follows:

```
n = 10;
k = 5;
factorial = @(n) gamma(n+1);
ways = factorial(n) / (factorial(k) * factorial(n-k));
disp(ways);
```

This code calculates the factorial of numbers using the gamma function (gamma(n+1) is equivalent to n! for positive integers), and then computes the number of ways to divide the set using the binomial coefficient formula. The result is displayed using the `disp` function.

So, the problem can be solved programmatically using GNU Octave.

