function max_cone_volume = max_cone_volume_inside_sphere(radius)
    sphere_volume = 4/3 * pi * radius^3;
    cone_height = radius;
    cone_radius = radius;
    cone_volume = pi/3 * cone_radius^2 * cone_height;

    while (cone_volume <= sphere_volume)
        cone_height = cone_height + radius;
        cone_volume = pi/3 * cone_radius^2 * cone_height;
    endwhile

    max_cone_volume = cone_volume;
endfunction

